  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 14px;
      font-family: sans-serif;
      font-size: 104.13% !important;
      line-height: 183.43% !important;
    }

    html {
      color-scheme: light dark
    }

    body {
      font-family: Arial, 'Helvetica Neue', Helvetica, sans-serif;
      overflow: hidden;
      font-size: 18px;
      color: #000;
      width: 100%;
      max-width: 600px;
      margin: 0 auto;
      background: #f9f9f9;
    }

    .main {
      padding: 10px;
      background: #ffffff;
    }

    img {
      max-width: 100%
    }

    .header {
      background: #161616;
      padding: 0 10px
    }

    .header__wrapper {
      height: 40px;
      display: flex;
      align-items: center;
      justify-content: space-between
    }

    .header__logo {
      font-weight: 700;
      font-size: 1.5rem;
      text-align: center;
      letter-spacing: .5px;
      color: #fff
    }

    .header__logo span {
      color: #da1300;
      font-size: inherit
    }

    .main__info {
      text-align: center;
      font-size: 13px;
      color: #000;
      padding: 10px 5px;
      text-overflow: ellipsis;
      font-weight: 600
    }

    .main__info span {
      color: #de2600
    }

    .main__wrapper {
      width: 100%;
      margin: 0 auto
    }

    .main__item {
      margin-bottom: 10px
    }

    .main__item .item__image {
      position: relative
    }

    .main__item .item__image:before {
      content: '';
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 60px;
      height: 60px;
      background-color: rgba(0, 0, 0, .6);
      border-radius: 50%;
      cursor: pointer;
      z-index: 2
    }

    .main__item .item__image:after {
      content: '';
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 0;
      height: 0;
      border-top: 10px solid transparent;
      border-bottom: 10px solid transparent;
      border-left: 16px solid #fff;
      z-index: 3
    }

    .main__item .image {
      display: block;
      width: 100%
    }

    .item__time {
      position: absolute;
      bottom: 8px;
